import React from 'react';
import Link from 'next/link';

// Style
import { Container } from './styles';

const Menu = () => {
	return (
		<Container>
			<Link href="/">
				<a>Store</a>
			</Link>
			<Link>
				<a>Library</a>
			</Link>
			<Link>
				<a>Community</a>
			</Link>
			<Link>
				<a>Support</a>
			</Link>
		</Container>
	);
};

export default Menu;
